import React, { useState } from "react";
import Arrow_up from "../../asset/arrow_up.png";
import Arrow_down from "../../asset/arrow_down.png";
import Cat from "../../asset/cat.png";
import clsx from "clsx";
import styles from "../../../src/app.module.css";


const NestedList2 = () => {
  const [div2, setDiv2] = useState(true);
  const arrow_up_function = () => {
    setDiv2(false);
  };
  const arrow_down_function = () => {
    setDiv2(true);
  };

  return (
    <div className="nestlist1 ">
      <div>
        <div>
          <p>Hooks</p>
          {div2 ? (
            <img
              onClick={() => {
                arrow_up_function();
              }}
              src={Arrow_up}
              alt="arrow_up"
            ></img>
          ) : (
            <img
              onClick={() => {
                arrow_down_function();
              }}
              src={Arrow_down}
              alt="arrow_up"
            ></img>
          )}
        </div>
        <div className={clsx(div2 && styles.disappear)}>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useState</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useEffect</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useRef</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useContext</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useCallback</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useMemo</p>
          </div>
          <div>
            <img src={Cat} alt="cat"></img>
            <p>useReducer</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NestedList2;
